function greeting(name) {
    let greeting;
    const date = new Date();
    const hours = date.getHours();

    if (hours >= 4 && hours < 12) {
        greeting = `Good morning ${name}`;
    } else if (hours >= 12 && hours < 17) {
        greeting = `Good afternoon ${name}`;
    } else if (hours >= 17 && hours < 20) {
        greeting = `Good evening ${name}`;
    }
}




